import React from 'react';
import { Grid } from '@material-ui/core';

function CharactersContainer(props) {
  return (
    <div>
      <Grid
        container
        spacing={2}
        alignContent='center'
        justify='center'
        className={classes.root}
      >
        {props.children}
      </Grid>
    </div>
  );
}

export default CharactersContainer;
